import Navbar from "../components/NavbarLogin";
import React, { useState, useEffect } from "react";
import { useNavigate, Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import AOS from "aos";
import "aos/dist/aos.css";
import { LoginUser, reset, getMe } from "../auth/authSlice";
import Logo from "../images/logo-white.png";
import { ProgressBar } from "react-loader-spinner";

export default function Register() {
  return (
    <div className="">
      <div className="flex items-center mx-10">
        <a href="/home" className="pointer-events-none group">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            viewBox="0 0 24 24"
            strokeWidth="2"
            stroke="#B7B6B8"
            className="w-10 h-10 border-[3px] border-[#B7B6B8] rounded-full mr-2 pointer-events-auto group-hover:stroke-[#205AFC]">
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              d="M15.75 19.5L8.25 12l7.5-7.5"
            />
          </svg>
        </a>
        <span className="text-gray-700 font-semibold">Back</span>
      </div>
    </div>
  );
}
